import './Dashboard.css';
import { useEffect, useState } from "react";
import { getLogs } from "../api";

export default function Dashboard() {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    const email = localStorage.getItem("email");
    if (email) {
      getLogs(email).then(res => setLogs(res.data));
    }
  }, []);

  const totalErrors = logs.reduce((sum, l) => sum + l.errorCount, 0);
  const totalWarnings = logs.reduce((sum, l) => sum + l.warningCount, 0);

  return (
    <div className="dashboard">
      <h1>ðŸ“Š Dashboard</h1>
      <p className="subtitle">Log analysis summary</p>

      {/* SUMMARY CARDS */}
      <div className="card-container">
        <div className="card">
          <h3>Total Files</h3>
          <p>{logs.length}</p>
        </div>
        <div className="card">
          <h3>Total Errors</h3>
          <p>{totalErrors}</p>
        </div>
        <div className="card">
          <h3>Total Warnings</h3>
          <p>{totalWarnings}</p>
        </div>
      </div>

      {/* TABLE */}
      <table className="log-table">
        <thead>
          <tr>
            <th>File Name</th>
            <th>Errors</th>
            <th>Warnings</th>
            <th>Status</th>
            <th>Uploaded At</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, i) => (
            <tr key={i}>
              <td>{log.fileName}</td>
              <td>{log.errorCount}</td>
              <td>{log.warningCount}</td>
              <td>{log.status}</td>
              <td>{log.createdAt?.replace("T", " ")}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
